import React from "react";
import classes from "./Money.module.css";
import { useState, useRef, useEffect } from "react";
import Count from "./Count";

function Money() {
  const [isIntersecting, setIsIntersecting] = useState(false);
  const ref = useRef(null);

  useEffect(() => {
    const observer = new IntersectionObserver(
      ([entry]) => {
        setIsIntersecting(entry.isIntersecting);
      },
      { rootMargin: "-150px" }
    );

    observer.observe(ref.current);

    return () => observer.disconnect();
  }, [isIntersecting]);

  return (
    <div className={classes.container}>
      <div className={classes.cards}>
        <div>
          <h1 ref={ref}>Funded</h1>
          {isIntersecting ? (
            <p className={classes.number}>
              <Count className={classes.box} number={"29"} duration={"2"} />
              <div className={classes.box}>.</div>
              <Count className={classes.box} number={"33"} duration={"2"} />
            </p>
          ) : (
            ""
          )}
        </div>
        <div>
          <h1>Community Contributions</h1>
          <p>$ 8.88 M</p>
        </div>
        <div>
          <h1>Buidls</h1>
          <p>7,182</p>
        </div>
        <div>
          <h1>Active Builders</h1>
          <p>98,924</p>
        </div>
      </div>
    </div>
  );
}

export default Money;
